@TGRofficial2k25 see i apologize for my language cause it of course is not a great feeling when i look back into it. But the thing i hate about today's late gen z or early gen alphas are that they come to argue or debate without much research or experience about it. See i appreciate your curiosity and i love when people are curious but there are things in life which can only come with experience. I have been an aviation geek since my childhood. Part of my motivation to do mechanical engineering was to enter the aviation industry and im still working on it to make that possible. I have been following numerous crashes since almost like a decade already. I see their investigations and how they are handled by different nations.

See while its true pointing fingers on government is not gonna solve problems but the responsible body should be accountable . Do you not agree? Imagine yourself as a family of those victims. When taking sides try to think from both sides not just a single one. I have flown in several boeings and airbuses so far and even i could feel the difference in airlines. Air india during government ownership was so bad you could literally feel huge difference between them and european carriers. I have not flown in them since the tata takeover but i have seen numerous complaints about them too. 

One of my friend passed away during lion air crash of boeing 737 max back in 2019 if u know the events sorrounding it and i know how negligent authorities can be so i ask for accountability on any crashes or major accidents that happen. Its not just out of hate or something its born out of experience. Gonna be a long read. Wish you good luck for your future
